import React from "react";
import "./styles/Home.css";
import Fade from "react-reveal/Fade";

function Home() {
  return (
    <Fade duration={5000}>
      <h3 className={"title-text"}>Hi, I'm James.</h3>
    </Fade>
  );
}

export default Home;
